import React from 'react'
import "../pages/dashboard.css" 

class TestFetch extends React.Component{ 

    constructor(props) {
        super(props);
        this.state = {bus_id: [], amount_user: [], date: [] };
      }

    async componentDidMount() {
        const res = await fetch('http://127.0.0.1:5000/api/database/user_info');
        const data = await res.json();
        this.setState({bus_id: [data.user_id]})
        console.log(data);
        console.log(typeof(this.state.user_id));
    }

    render(){
        return (
            <div className='App'>
                Hello
                {this.state.user_id}
            </div>
        );
    }
}
export default TestFetch;
